import React from 'react';

const HomePage = () => {
  return (
    <div>
      <h1>Welcome to Our Concept Project in Dubai!</h1>
      <p>
        We specialize in providing innovative solutions and premium services tailored for individuals and businesses
        looking to explore opportunities in Dubai and beyond. Our mission is to bridge the gap between global investors
        and the thriving market of Dubai, offering unparalleled transparency and reliability in every interaction.
      </p>
    </div>
  );
};

export default HomePage;
